import React, { useEffect, useRef } from 'react';
import './App.css';

const App = () => {
  const canvasRef = useRef(null);
  
  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');
    
    // Set canvas size
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;
    
    // Particles array
    const particles = [];
    const particleCount = 50;
    
    // Create particles
    for (let i = 0; i < particleCount; i++) {
      particles.push({
        x: Math.random() * canvas.width,
        y: Math.random() * canvas.height,
        size: Math.random() * 2 + 1,
        speedX: (Math.random() - 0.5) * 0.5,
        speedY: (Math.random() - 0.5) * 0.5,
        color: `rgba(102, 126, 234, ${Math.random() * 0.3 + 0.1})`
      });
    }
    
    // Animation function
    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      
      // Update and draw particles
      particles.forEach(particle => {
        particle.x += particle.speedX;
        particle.y += particle.speedY;
        
        // Bounce off walls
        if (particle.x < 0 || particle.x > canvas.width) particle.speedX *= -1;
        if (particle.y < 0 || particle.y > canvas.height) particle.speedY *= -1;
        
        // Draw particle
        ctx.beginPath();
        ctx.arc(particle.x, particle.y, particle.size, 0, Math.PI * 2);
        ctx.fillStyle = particle.color;
        ctx.fill();
      });
      
      // Draw connections
      for (let i = 0; i < particles.length; i++) {
        for (let j = i + 1; j < particles.length; j++) {
          const dx = particles[i].x - particles[j].x;
          const dy = particles[i].y - particles[j].y;
          const distance = Math.sqrt(dx * dx + dy * dy);
          
          if (distance < 100) {
            ctx.beginPath();
            ctx.strokeStyle = `rgba(102, 126, 234, ${0.1 * (1 - distance/100)})`;
            ctx.lineWidth = 0.5;
            ctx.moveTo(particles[i].x, particles[i].y);
            ctx.lineTo(particles[j].x, particles[j].y);
            ctx.stroke();
          }
        }
      }
      
      requestAnimationFrame(animate);
    };
    
    animate();
    
    // Handle resize
    const handleResize = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };
    
    window.addEventListener('resize', handleResize);
    
    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  const projects = [
    {
      id: 1,
      title: "E-Commerce Platform",
      description: "Full-stack e-commerce platform with secure payment integration and user authentication",
      technologies: ["Django", "React", "MySQL", "AWS"],
      githubLink: "https://github.com/IqraMajeed-Dev/ecommerce-platform"
    },
    {
      id: 2,
      title: "Hotel Booking System",
      description: "Hotel reservation system with real-time availability and booking management",
      technologies: ["Python", "Django", "React", "PostgreSQL"],
      githubLink: "https://github.com/IqraMajeed-Dev/hotel-booking"
    },
    {
      id: 3,
      title: "Flutter E-Commerce App",
      description: "Cross-platform mobile e-commerce application with beautiful UI",
      technologies: ["Flutter", "Dart", "REST API", "Firebase"],
      githubLink: "https://github.com/IqraMajeed-Dev/flutter-ecommerce"
    }
  ];

  const skills = [
    { name: "Python", level: 90 },
    { name: "Django", level: 85 },
    { name: "React JS", level: 80 },
    { name: "JavaScript", level: 85 },
    { name: "MySQL", level: 80 },
    { name: "PostgreSQL", level: 75 },
    { name: "AWS", level: 70 },
    { name: "Flutter", level: 75 },
    { name: "HTML & CSS", level: 95 },
    { name: "Git & GitHub", level: 85 },
    { name: "RESTful APIs", level: 90 }
  ];

  return (
    <div className="App">
      {/* Animated Background Canvas */}
      <canvas 
        ref={canvasRef} 
        className="background-canvas"
        style={{
          position: 'fixed',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          zIndex: -1
        }}
      />
      
      {/* Animated Gradient Overlay */}
      <div className="gradient-overlay"></div>

      {/* Header Section */}
      <header className="header">
        <div className="container">
          <div className="nav">
            <div className="logo">
              <h2>Iqra Majeed</h2>
            </div>
            <nav className="nav-links">
              <a href="#home">Home</a>
              <a href="#about">About</a>
              <a href="#skills">Skills</a>
              <a href="#projects">Projects</a>
              <a href="#contact">Contact</a>
            </nav>
          </div>
        </div>
      </header>

      {/* Hero Section */}
      <section id="home" className="hero">
        <div className="container">
          <div className="hero-content">
            <div className="hero-text">
              <h1 className="hero-title">
                Hi, I'm <span className="highlight">Iqra Majeed</span>
              </h1>
              <h2 className="hero-subtitle">Full Stack Developer</h2>
              <p className="hero-description">
                I create amazing web and mobile applications using modern technologies 
                like React, Django, Python, and Flutter.
              </p>
              <div className="hero-buttons">
                <a href="#projects" className="btn btn-primary">
                  <i className="fas fa-briefcase"></i> View My Work
                </a>
                <a href="#contact" className="btn btn-secondary">
                  <i className="fas fa-paper-plane"></i> Get In Touch
                </a>
              </div>
            </div>
            <div className="hero-image">
              <div className="floating-card">
                <div className="card-content">
                  <div className="tech-stack">
                    <span className="tech-item">React</span>
                    <span className="tech-item">Django</span>
                    <span className="tech-item">Python</span>
                    <span className="tech-item">Flutter</span>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div className="scroll-indicator">
            <div className="scroll-arrow"></div>
          </div>
        </div>
      </section>

      {/* About Section */}
      <section id="about" className="about">
        <div className="container">
          <h2 className="section-title">About Me</h2>
          <div className="about-content">
            <div className="about-card">
              <div className="about-text">
                <p>
                  I'm <strong>Iqra Majeed</strong>, a passionate <strong>Full Stack Developer</strong> 
                  currently pursuing a <strong>Bachelor of Science in Engineering Technology</strong>.
                </p>
                <p>
                  I specialize in creating scalable web and mobile applications using 
                  modern technologies and best practices.
                </p>
                <div className="about-stats">
                  <div className="stat">
                    <h3>6+</h3>
                    <p>Projects</p>
                  </div>
                  <div className="stat">
                    <h3>2+</h3>
                    <p>Certificates</p>
                  </div>
                  <div className="stat">
                    <h3>90+</h3>
                    <p>APIs Built</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Skills Section */}
      <section id="skills" className="skills">
        <div className="container">
          <h2 className="section-title">My Skills</h2>
          <div className="skills-grid">
            {skills.map((skill, index) => (
              <div key={index} className="skill-card">
                <div className="skill-header">
                  <span className="skill-name">{skill.name}</span>
                  <span className="skill-percentage">{skill.level}%</span>
                </div>
                <div className="skill-bar">
                  <div 
                    className="skill-progress" 
                    style={{ width: `${skill.level}%` }}
                  ></div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Projects Section */}
      <section id="projects" className="projects">
        <div className="container">
          <h2 className="section-title">My Projects</h2>
          <div className="projects-grid">
            {projects.map(project => (
              <div key={project.id} className="project-card">
                <div className="project-icon">
                  <i className="fas fa-code"></i>
                </div>
                <div className="project-content">
                  <h3 className="project-title">{project.title}</h3>
                  <p className="project-description">{project.description}</p>
                  <div className="project-technologies">
                    {project.technologies.map((tech, index) => (
                      <span key={index} className="tech-tag">{tech}</span>
                    ))}
                  </div>
                  <a 
                    href={project.githubLink} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="project-link"
                  >
                    <i className="fab fa-github"></i> View Code
                  </a>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Contact Section */}
      <section id="contact" className="contact">
        <div className="container">
          <h2 className="section-title">Get In Touch</h2>
          <div className="contact-content">
            <div className="contact-info">
              <div className="contact-card">
                <i className="fas fa-envelope"></i>
                <h3>Email</h3>
                <p>iqramajeed.dev@gmail.com</p>
              </div>
              <div className="contact-card">
                <i className="fab fa-github"></i>
                <h3>GitHub</h3>
                <p>IqraMajeed-Dev</p>
              </div>
              <div className="contact-card">
                <i className="fas fa-map-marker-alt"></i>
                <h3>Location</h3>
                <p>Lahore, Pakistan</p>
              </div>
            </div>
            <div className="contact-form">
              <h3>Send Message</h3>
              <form>
                <input type="text" placeholder="Your Name" required />
                <input type="email" placeholder="Your Email" required />
                <textarea placeholder="Your Message" rows="5" required></textarea>
                <button type="submit" className="btn btn-primary">
                  <i className="fas fa-paper-plane"></i> Send Message
                </button>
              </form>
            </div>
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <div className="container">
          <p>&copy; 2024 Iqra Majeed. Built with React</p>
        </div>
      </footer>
    </div>
  );
};

export default App;
